  return (
    <div>
      <img src="https://image.hm.com/assets/hm/b0/82/b08251de6183ba5f4be7db49474232170f3f6e5f.jpg?imwidth=256"/>
      <div> Conscious choice</div>
      <div>벨티드 트윌 코트</div>
      <div>\99900</div>
      <div>신제품</div>
    </div>
  )
}

export default ProductCard
